import {withRouter} from 'next/router'

const NewsDetail = ({router: {query}}) => {
    const object = JSON.parse(query.news);
    console.log(object);
    
    return (
        <div>
            <h1></h1>
        </div>
    )
}

export default withRouter(NewsDetail);
